; 3) {\n    const productName = $el.find(_productConstants.inventoryPage.inventoryItem).text().trim();\n    selectedProducts.push(productName);\n    cy.wrap($el).find(_productConstants.inventoryPage.addToCart).click();\n    cy.wrap($el).find(_productConstants.inventoryPage.removeFromCart).should(\&quot;have.text\&quot;, \&quot;Remove\&quot;);\n  }\n});\n// cart count validation\ncy.get(_productConstants.globalComponents.shoppingCartBadge).should(\&quot;be.visible\&quot;).and(\&quot;have.text\&quot;, \&quot;3\&quot;);\n// Navigate to your cart page and check count\ncy.get(_productConstants.globalComponents.shoppingCart).click();\ncy.url().should(\&quot;include\&quot;, _productConstants.pageURLs.yourCart);\ncy.get(_productConstants.inventoryPage.allInventoryItemsList).should(\&quot;have.length\&quot;, 3);\ncy.get(_productConstants.inventoryPage.inventoryItem).each($el =&gt; {\n  const cartProductName = $el.text().trim();\n  expect(selectedProducts).to.include(cartProductName);\n});\n//  Remove only first 2 products\ncy.get(_productConstants.inventoryPage.allInventoryItemsList).each(($el, index) =&gt; {\n  if (index &lt; 2) {\n    cy.wrap($el).find(_productConstants.yourCartPage.removeItemFromCart).click();\n  }\n});\n//  Cart count validation\ncy.get(_productConstants.globalComponents.shoppingCartBadge).then($badge =&gt; {\n  if ($badge.length &gt; 0) {\n    cy.wrap($badge).should(\&quot;have.text\&quot;, \&quot;1\&quot;);\n  } else {\n    cy.log(\&quot;Cart is empty, badge is not visible\&quot;);\n  }\n});\n// Ensure only 1 product remains in the cart\ncy.get(_productConstants.inventoryPage.allInventoryItemsList).should(\&quot;have.length\&quot;, 1);&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;d6a6dc80-4586-4c31-8ad6-75e69fa22720&quot;,&quot;parentUUID&quot;:&quot;1449d4e0-d206-4058-84b6-f47764aeea5b&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;Test 2.2: After empty the cart and verify no products remain&quot;,&quot;fullTitle
